import React, {Component} from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";

import axios from 'axios';
import Menu from './components/Menu.js';
import Home from './components/Home.js';
import About from './components/About.js';
import Portfolio from './components/Portfolio.js';
import Contact from './components/Contact.js';
import TwentyFourtyEight from './components/TwentyFourtyEight.js';
import SimpleModal from './components/SimpleModal.js';
import Swing from './components/Swing.js';
import Rocket from './components/Rocket.js';
import Playground from './components/Playground.js';
import Loader from './components/Loader.js';

import './css/App.css';
import $ from "jquery";


class App extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      loading: false,
      tabs: ["home", "about", "resume", "portfolio", "contact"]
    }
    this.loader = this.loader.bind(this);
  }
  loader() {
    var {loading} = this.state;
    if(loading) {
      $(".loader").fadeOut("slow");
      return(
        <Loader />     
      )
    }
    if(!loading) {

      return(
        <div className="app-wrapper">
          <div className="menu">
            <span/>
            <a href="home">
              <span></span>
              <span></span>
              <span></span>
              <span></span>
              <span></span>
              {"Home"}
            </a>
            <span/>
            <span/>
            <a href="about">
              <span></span>
              <span></span>
              <span></span>
              <span></span>
              <span></span>
              {"About"}
            </a>
            <span/>
            <span/>
            <a href="portfolio">
              <span></span>
              <span></span>
              <span></span>
              <span></span>
              <span></span>
              {"Portfolio"}
            </a>
            <span/>
            <span/>
            <a href="contact">
              <span></span>
              <span></span>
              <span></span>
              <span></span>
              <span></span>
              {"Contact"}
            </a>
            <span/>
          </div>
          <div className="main">
            <div class="hexagon">
              <div class="circle"></div>
            </div>
            <h1>hexagon<span>circle</span></h1>
          </div>
          <div class="panel left"></div>
<div class="panel right"></div>
<button></button>
          <Router>
            <Route path="/home" component={Home}></Route>
            <Route path="/home" component={About}></Route>
            <Route path="/home" component={Portfolio}></Route>
            <Route path="/home" component={Contact}></Route>
          </Router>
        </div>    
      )
    }
  }
  componentDidMount() {
    setTimeout(() => (this.setState({loading: false})),7000)
  }
  render() {
      return (
        <div className="main">
            {this.loader()}
        </div>
      )
    }


}

export default App;
